//"rafce" this stands for "react arror function component export", it a shortcut

import React from 'react'
import './boo'
 

const Book = () => {
    const nameOfTheBook="Concise Laws Of Human Nature";
    const nameOfTheAuthor="Rober Green";
    const Rating = 4;
    const price = 20;
  return (
    <div className="book-card">
    <div className="book-content">
      <h1 className="book-title">{nameOfTheBook}</h1>
      <h3 className="book-author">By {nameOfTheAuthor}</h3>
      <div className="book-details">
        <h4 className="book-rating">Rating = {Rating}</h4>
        <h4 className="book-price">Price = ${price}</h4>
      </div>
    </div>
  </div>
  )


}

export default Book
